import React, { Component } from 'react';

import "./widget1.css"
import AreaChart from './area charts/Area Chart';
import Titre1 from './Titre1/titre1';
import Comment1 from './Comment1/comment1';

const data = [
    {
      name: 'Page A', uv: 4000, pv: 2400, amt: 2400,
    },
    {
      name: 'Page B', uv: 3000, pv: 1398, amt: 2210,
    },
    {
      name: 'Page C', uv: 2000, pv: 9800, amt: 2290,
    },
    {
      name: 'Page D', uv: 2780, pv: 3908, amt: 2000,
    },
    {
      name: 'Page E', uv: 1890, pv: 4800, amt: 2181,
    },
    {
      name: 'Page F', uv: 2390, pv: 3800, amt: 2500,
    },
    {
      name: 'Page G', uv: 3490, pv: 4300, amt: 2100,
    },
  ];

class Widget1 extends Component{

    render(){

        const { titre1, comment1 } = this.props.data1 ; 
        return(
            <div className="cont1">
            <Titre1 titre1={titre1}/>
            <Comment1 comment1={comment1}/>
            <AreaChart data ={data}/>
          </div>
        );
    }

}


export default Widget1;
